import React from 'react';
import Card from '../Card';
import './Products.css';

const products = [
  {
    number: '01',
    title: 'TMT Bars',
    description:
      'Thermo-Mechanically Treated bars, also known as TMT bars, are high-strength reinforcement bars with a tough outer core and a soft inner core. They are widely used in the construction industry due to their superior strength and flexibility.',
    image: 'products/TMT Bars.jpg',
  },
  {
    number: '02',
    title: 'MS Plate',
    description:
      'Thermo-Mechanically Treated bars, also known as TMT bars, are high-strength reinforcement bars with a tough outer core and a soft inner core. They are widely used in the construction industry due to their superior strength and flexibility.',
    image: 'products/MS Plate.jpg',
  },
  {
    number: '03',
    title: 'MS Beam',
    description:
      'Thermo-Mechanically Treated bars, also known as TMT bars, are high-strength reinforcement bars with a tough outer core and a soft inner core. They are widely used in the construction industry due to their superior strength and flexibility.',
    image: 'products/MS Beam.webp',
  },
  {
    number: '04',
    title: 'MS And GI Pipe',
    description:
      'Thermo-Mechanically Treated bars, also known as TMT bars, are high-strength reinforcement bars with a tough outer core and a soft inner core. They are widely used in the construction industry due to their superior strength and flexibility.',
    image: 'products/ms pipe.jpg',
  },
  {
    number: '05',
    title: 'MS Channel',
    description:
      'Thermo-Mechanically Treated bars, also known as TMT bars, are high-strength reinforcement bars with a tough outer core and a soft inner core. They are widely used in the construction industry due to their superior strength and flexibility.',
    image: 'products/M S Channel.jpg',
  },
  {
    number: '06',
    title: 'Flat And Angle',
    description:
      'Thermo-Mechanically Treated bars, also known as TMT bars, are high-strength reinforcement bars with a tough outer core and a soft inner core. They are widely used in the construction industry due to their superior strength and flexibility.',
    image: 'products/Flat And Angle.jpg',
  },
];

const Products = () => {
  return (
    <section className="products-section">
      <div className="products-header">
        <p className="subheading">WHAT WE DO</p>
        <h2 className="title">Services We Provide</h2>
      </div>
      <div className="products-grid">
        {products.map((product, index) => (
          <Card key={index} product={product} />
        ))}
      </div>
      {/* View More Button */}
      <div className="view-more-container">
        <a href="/all-products" className="view-more-button">
          View More <span className="arrow-symbol">â†’</span>
        </a>
      </div>
    </section>
  );
};

export default Products;
